import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import DoctorList from './components/DoctorList';
import BookingPage from './components/BookingPage'; // Import your Booking page component

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/doctors" component={DoctorList} />
        <Route path="/book/:id" component={BookingPage} /> {/* Booking route */}
        {/* Add other routes as needed */}
      </Switch>
    </Router>
  );
};

export default App;
